import Link from 'next/link';
import Image from 'react-bootstrap/Image';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../static/css/style.css'

const Nav = () => (
  	<div>
  	<ul id="nav"> 
	    <li><Link href="/">
	      <a>Home</a>
	    </Link></li>
	    <li><Link href="/books">
	      <a>Books</a>
	    </Link></li>
	    <li><Link href="/profile">
	      <a>Profile</a>
	    </Link></li>
    </ul>
  	</div>
);

export default Nav;
